import React from 'react'

export default function Footer() {
    return (
        <div>
            <p>חווה בעיה במערכת? דווח עלי כאן
            חושב שאפשר לשפר משהו במערכת? הצע את השיפור כאן
            </p>
        </div>
    )
}
